import React, { Component } from 'react';
import './../assets/container.scss'

export default class Container extends Component {
    render () {
        const dataList = [
            {
                title:'1111',
                content:'lorem111'
            },
            {
                title:'2222',
                content:'lorem222'
            },
            {
                title:'3333',
                content:'lorem333'
            },
            {
                title:'4444',
                content:'lorem444'
            }
        ]
        return (
            <div className="wraper">
                <div className="trangle">
                    <div></div>
                    <div></div>
                    <div></div>
                    <div className="descripion">My webSite</div>
                    <div className="name">JIN LIN</div>
                </div>
                <div className="trangle two">
                    <div></div>
                    <div></div>
                    <div></div>
                    <div></div>
                </div>
                <div className="wrapGrey_one">
                    <div className="greyTrangle">
                        {dataList.map((data)=>{
                            return (
                            <div className="whiteBlock">
                                <div>{data.title}</div>
                            </div>
                            )
                        })}

                    </div>
                </div>
                <div className="wrapCircle">
                    <div className="circle"></div>
                </div>
            </div>
        )
    }
}
